					["RewardHonor"] = 0,
					["Text"] = "I hear the voice of my brother, Minshina, calling to me in my dreams.\n\nHe was taken by Zalazane, the warlock on the Echo Isles to the east. And he is dead.\n\nBut death is not freedom for my brother. Minshina's spirit was trapped within his own skull by Zalazane's magics. In my dreams I see it with other skulls, in a circle of power on the largest Echo Isle. As long as it remains there my brother's soul is doomed.\n\nPlease, Teleprter. Find the circle and retrieve Minshina's skull. Bring it to me.\n\nFree him!",
